//IOS等用户直接用NobyDa的jd cookie
let cookiesArr = [], cookie = '', message = '', allMessage = '';
let isLoginInfo = {}
if ($.isNode()) {
  Object.keys(jdCookieNode).forEach((item) => {
    cookiesArr.push(jdCookieNode[item])
  })
  if (process.env.JD_DEBUG && process.env.JD_DEBUG === 'false') console.log = () => {};
//  if (JSON.stringify(process.env).indexOf('GITHUB') > -1) process.exit(0)
} else {
  cookiesArr = [$.getdata('CookieJD'), $.getdata('CookieJD2'), ...jsonParse($.getdata('CookiesJD') || "[]").map(item => item.cookie)].filter(item => !!item);
}
let inviteCodes = [];
const JD_API_HOST = 'https://api.m.jd.com/api';
!(async () => {
  if (!cookiesArr[0]) {
    $.msg($.name, '【提示】请先获取京东账号一cookie\n直接使用NobyDa的京东签到获取', 'https://bean.m.jd.com/bean/signIndex.action', {"open-url": "https://bean.m.jd.com/bean/signIndex.action"});
    return;
  }
  $.temp = [];
  $.updatePkActivityIdRes = await getAuthorShareCode('https://raw.githubusercontent.com/1994112/updateTeam1/master/shareCodes/jd_cityShareCodes.json')
  if (!$.updatePkActivityIdRes) {
    $.http.get({url: 'https://purge.jsdelivr.net/gh/1994112/updateTeam1@master/shareCodes/jd_cityShareCodes.json'}).then((resp) => {}).catch((e) => $.log('刷新CDN异常', e));
    await $.wait(1000)
    $.updatePkActivityIdRes = await getAuthorShareCode('https://cdn.jsdelivr.net/gh/1994112/updateTeam1@master/shareCodes/jd_cityShareCodes.json')
  }
  await requireConfig();
  for (let i = 0; i < cookiesArr.length; i++) {
    if (cookiesArr[i]) {
      cookie = cookiesArr[i];
      $.UserName = decodeURIComponent(cookie.match(/pt_pin=([^; ]+)(?=;?)/) && cookie.match(/pt_pin=([^; ]+)(?=;?)/)[1])
      $.index = i + 1;
      $.isLogin = true;
      $.nickName = '';
      $.beans = 0;//本次运行获得京豆数量
      $.blockAccount = false;//黑号
      message = '';
      await TotalBean();
      isLoginInfo[$.UserName] = $.isLogin
      console.log(`\n开始【京东账号${$.index}】${$.nickName || $.UserName}\n`);
      if (!$.isLogin) {
        $.msg($.name, `【提示】cookie已失效`, `京东账号${$.index} ${$.nickName || $.UserName}\n请重新登录获取\nhttps://bean.m.jd.com/bean/signIndex.action`, {"open-url": "https://bean.m.jd.com/bean/signIndex.action"});

        if ($.isNode()) {
          await notify.sendNotify(`${$.name}cookie已失效 - ${$.UserName}`, `京东账号${$.index} ${$.UserName}\n请重新登录获取cookie`);
        }
        continue
      }
      await shareCodesFormat();
      await JD818();
      await $.wait(1000)
    }
  }
  for (let i = 0; i < cookiesArr.length; i++) {
    if (cookiesArr[i]) {
      cookie = cookiesArr[i];
      $.canHelp = true;//能否助力
      $.UserName = decodeURIComponent(cookie.match(/pt_pin=([^; ]+)(?=;?)/) && cookie.match(/pt_pin=([^; ]+)(?=;?)/)[1])
      if (!isLoginInfo[$.UserName]) continue
      if ((cookiesArr && cookiesArr.length >= 1) && ($.temp && $.temp.length)) {
        console.log(`\n先自己账号内部相互邀请助力`);
        for (let j = 0; j < $.temp.length && $.canHelp; j++) {
          console.log(`\n${$.UserName} 去助力 ${$.temp[j]}`);
          $.delcode = false;
          await toHelp($.temp[j].trim());
          if ($.delcode) {
            $.temp.splice(j, 1)
            j--
            continue
          }
        }
      }
      if ($.canHelp && ($.newShareCodes && $.newShareCodes.length)) {
        console.log(`\n\n如果有剩余助力机会，则给作者助力`)
        for (let j = 0; j < $.newShareCodes.length && $.canHelp; j++) {
          console.log(`\n${$.UserName} 去助力 ${$.newShareCodes[j]}`);
          $.delcode = false;
          await toHelp($.newShareCodes[j].trim());
          if ($.delcode) {
            $.newShareCodes.splice(j, 1)
            j--
            continue
          }
        }
      }
    }
  }
  // console.log(JSON.stringify($.temp))
  if (allMessage) {
    //NODE端,默认每月一日运行进行推送通知一次
    if ($.isNode()) {
      await notify.sendNotify($.name, allMessage, { url: "https://carnivalcity.m.jd.com/" });
      $.msg($.name, '', allMessage);
    }
  }
})()
    .catch((e) => {
      $.log('', `❌ ${$.name}, 失败! 原因: ${e}!`, '')
    })
    .finally(() => {
      $.done();
    })

async function JD818() {
  try {
    await supportList();//助力情况
    await getHelp();//获取邀请码
    if ($.blockAccount) return
    await showMsg()
  } catch (e) {
    $.logErr(e)
  }
}

//获取助力信息
function supportList() {
  const body = {"apiMapping":"/khc/index/supportList"}
  return new Promise( (resolve) => {
    $.get(taskUrl(body), async (err, resp, data) => {
      try {
        if (err) {
          console.log(`${JSON.stringify(err)}`)
          console.log(`${$.name} API请求失败，请检查网路重试`)
        } else {
          data = JSON.parse(data);
          if (data.code === 200) {
            console.log(`助力情况：${data['data']['supportedNums']}/${data['data']['supportNeedNums']}`);
            message += `邀请好友助力：${data['data']['supportedNums']}/${data['data']['supportNeedNums']}\n`
          }
        }
      } catch (e) {
        $.logErr(e, resp);
      } finally {
        resolve();
      }
    })
  });
}
//助力API
function toHelp(code) {
  return new Promise(resolve => {
    const body = {"shareId":code,"apiMapping":"/khc/task/doSupport"}
    $.post(taskUrl(body), (err, resp, data) => {
      try {
        if (err) {
          console.log(`${JSON.stringify(err)}`)
          console.log(`${$.name} API请求失败，请检查网路重试`)
        } else {
          data = JSON.parse(data);
          if (data && data['code'] === 200) {
            if (data.data.status === 6) {
              console.log(`助力成功`)
            } else if (data.data.status === 5) {
              console.log(`助力机会已耗尽，跳出助力`);
              $.canHelp = false
            } else if (data.data.status === 4) {
              console.log(`助力码 ${code} 已达上限`);
              $.delcode = true
            } else if (data.data.status === 3) {
              console.log(`已经助力过`);
            } else if (data.data.status === 2) {
              console.log(`助力码 ${code} 过期`);
              $.delcode = true
            } else if (data.data.status === 1) {
              console.log(`不能助力自己`);
            } else if (data.msg.indexOf('请求参数不合规') > -1) {
              console.log(`助力码 ${code} 助力码有问题`)
              $.delcode = true
            } else if (data.msg.indexOf('火爆') > -1) {
              console.log(`${data.msg}，跳出助力`)
              $.canHelp = false
            } else {
              console.log(`助力码 ${code} 助力结果\n${JSON.stringify(data)}`)
            }
            if (data['data']['jdNums']) $.beans += data['data']['jdNums'];
          }
        }
      } catch (e) {
        $.logErr(e, resp)
      } finally {
        resolve(data);
      }
    })
  })
}
//获取邀请码API
function getHelp() {
  return new Promise(resolve => {
    const body = {"apiMapping":"/khc/task/getSupport"}
    $.get(taskUrl(body), async (err, resp, data) => {
      try {
        if (err) {
          console.log(`${JSON.stringify(err)}`)
          console.log(`${$.name} API请求失败，请检查网路重试`)
        } else {
          data = JSON.parse(data);
          if (data.code === 200) {
            console.log(`\n\n${$.name}互助码每天都变化,旧的不可继续使用`);
            $.log(`【京东账号${$.index}（${$.UserName}）的${$.name}好友互助码】${data.data.shareId}\n\n`);
            $.temp.push(data.data.shareId);
          } else {
            console.log(`获取邀请码失败：${JSON.stringify(data)}`);
            if (data.code === 1002) $.blockAccount = true;
          }
        }
      } catch (e) {
        $.logErr(e, resp)
      } finally {
        resolve(data);
      }
    })
  })
}

function getAuthorShareCode(url) {
  return new Promise(async resolve => {
    const options = {
      url: `${url}?${new Date()}`, "timeout": 10000, headers: {
        "User-Agent": "Mozilla/5.0 (iPhone; CPU iPhone OS 13_2_3 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/13.0.3 Mobile/15E148 Safari/604.1 Edg/87.0.4280.88"
      }
    };
    if ($.isNode() && process.env.TG_PROXY_HOST && process.env.TG_PROXY_PORT) {
      const tunnel = require("tunnel");
      const agent = {
        https: tunnel.httpsOverHttp({
          proxy: {
            host: process.env.TG_PROXY_HOST,
            port: process.env.TG_PROXY_PORT * 1
          }
        })
      }
      Object.assign(options, { agent })
    }
    $.get(options, async (err, resp, data) => {
      try {
        resolve(JSON.parse(data))
      } catch (e) {
        // $.logErr(e, resp)
      } finally {
        resolve();
      }
    })
    await $.wait(10000)
    resolve();
  })
}

